import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import { Provider } from 'redux-thunk';


ReactDOM.render(
  <React.StrictMode>
    <Provider>
      <App />
    </Provider>

  </React.StrictMode>,
  document.getElementById('root')
);
